import {useState, useEffect} from 'react';
import Card from '../../Common/Wrapper';
import Col from 'react-bootstrap/Col';
import Table from 'react-bootstrap/Table';
import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';

function Create(){
    const [colors, setColors] = useState([]);

    useEffect(()=>{
        let tempColor = localStorage.getItem('colors');
        if(tempColor != null){
          setColors(JSON.parse(tempColor));
        }
    },[]);

    return (
        <Card>
            <Col sm={12} md={4} lg={6}>
                <Form onSubmit={()=>{registerColor()}} method="post">
                <FloatingLabel
                    controlId="floatingInput"
                    label="Color Name"
                    className="mb-3"
                >
                    <Form.Control 
                    name="color_name" 
                    type="text" 
                    placeholder="Color Name" 
                    onChange={(e)=> {handleChange(e)}} 
                    defaultValue={selectColorLength > 0 ? selectedColor.color_name : ""}
                    />
                </FloatingLabel>

                <Form.Check 
                    type="switch"
                    id="custom-switch"
                    label="Is Primary ?"
                    name="is_popular"
                    //checked={selectColorLength > 0 ? selectedColor.is_popular : false}
                    onChange={(e)=> {handleChange(e)}}
                />

                <FloatingLabel controlId="floatingPassword" label="Color code">
                    <Form.Control 
                    name="color_code" 
                    type="text" 
                    placeholder="Color Code" 
                    onChange={(e)=> {handleChange(e)}} 
                    defaultValue={selectColorLength > 0 ? selectedColor.color_code: ""}
                    />
                </FloatingLabel>

                <Button variant="primary" type="submit">
                    {selectColorLength > 0 ? "Update" : "Register"}
                </Button>
                </Form>
            </Col>
        </Card>
    )
}

export default Create;
